import './App.css';
import Header from './Header';
import { Routes, Route } from 'react-router-dom'
import Layout from './Layout';
import Post from './Post';


function App() {
  return (
    <Routes>
      <Route path='/' element={<Layout />}>
        <Route index element={<Post />} />
        <Route path={'/login'} element={<Layout />} />


      </Route>



    </Routes>

  );
}

export default App;
